&quot;A couple of sticks visit the Fair grounds, and find themselves participating in a series of adventures with the ultra-modern mechanism operated by robots. Finally, they reach the dance pavilion, and the wife and husband each are taken in hand by robots and whirled around the floor. Other mechanical gags give them a marvelous meal, beauty and barber treatments, and clinical attention to restore their youth. Very clever and novel. A Max Fleischer cartoon in Technicolor.&quot;

